/**
 * Navbar
 */

import React from 'react'
import Link from 'next/link'
import './nav.scss';

const links = [
  { href: '/about', label: 'About' },
  { href: '/contact', label: 'Contact' }
].map(link => {
  link.key = `nav-link-${link.href}-${link.label}`
  return link
})

const Nav = () => (
  <nav>
    <ul>
      <li>
        <Link href='/'>
          <a>Home</a>
        </Link>
      </li>
      {links.map(({ key, href, label }) => (
        <li key={key}>
          <Link href={href}>
            <a title={label}>{label}</a>
          </Link>
        </li>
      ))}
    </ul>
  </nav>
)

export default Nav
